We know that when you divide polynomials, the degree of the remainder must be *less than* the degree of the divisor.

*  Since the remainder,  *r(x)*, has a degree of 3, the divisor, *d(x)*, must have a degree greater than 3.

* The degree of the quotient, *q(x)*, is found by subtracting the degree of the divisor from the degree of the original polynomial:  deg(*q(x)*) = deg(*f(x)*) - deg(*d(x)*).

* To maximize the degree of *q(x)*, we want to minimize the degree of *d(x)*. The smallest possible degree for *d(x)* is 4 (it has to be bigger than 3).

* Therefore, the maximum possible degree of *q(x)* is 9 - 4 = 5.



